  false,\n\t\"url\": null,\n\t\"notes\": \"In 2012-13, Point Blue Conservation Science
  was contracted by the California Department of Fish and Wildlife to conduct surveys
  for the Western Yellow-billed Cuckoo along the Sacramento and Feather rivers. This
  data set describes where and when surveys were conducted and the results of each
  survey. Surveys were conducted in potential cuckoo habitat at randomly selected
  locations where researchers were able to obtain access. The results of the surveys
  are detailed in a report submitted to the CDFW.\",\n\t\"owner_org\": \"467d900f-8a42-452d-9906-6610dd1a767f\",\n\t\"extras\":
